package leetcode;

import java.util.HashMap;

public class _242ValidAnagram {
	public boolean isAnagram(String s, String t) {
		if ((s == null && s == null)
				|| (s.trim().isEmpty() && t.trim().isEmpty())) {
			return true;
		}
		if (s.length() != t.length()) {
			return false;
		}
		HashMap<Character, Integer> smap = convertToMap(s);
		HashMap<Character, Integer> tmap = convertToMap(t);
		return smap.equals(tmap);
	}

	public HashMap<Character, Integer> convertToMap(String s) {
		HashMap<Character, Integer> map = new HashMap<>();
		Character c = null;
		for (int i = 0; i < s.length(); i++) {
			c = s.charAt(i);
			if (map.get(c) == null) {
				map.put(c, 1);
			} else {
				map.put(c, map.get(c) + 1);
			}
		}
		return map;
	}

	public static void main(String[] args) {
		_242ValidAnagram a = new _242ValidAnagram();
//		System.out.println(a.isAnagram("anagram", "nagaram"));
//		System.out.println(a.isAnagram("car", "rat"));
//		System.out.println(a.isAnagram("kenanerkorkmaz", "erkorkmazkenan"));
//		System.out.println(a.isAnagram("kenanerkorkmaz", "erkorkmazkenans"));
		System.out.println(a.isAnagram(
				"",
				""));
	}

}
